import React from 'react';
import {useNavigate} from "react-router-dom";

const NavigateButtons = () => {
    let navigate = useNavigate();

    return (
        <>
            <div class="container" >
                <div class="row justify-content-end">
                    <h1 className="text-center">Navigation</h1>
                </div>
                <div class="row justify-content-end">
                    <button onclick={navigate('/clients')} className="btn btn-success m-1">Products</button>
                    <button onclick={()=>{<Link to="/clients"></Link>}} className="btn btn-warning m-1">Clients</button>
                    <button onclick="location.href='https://google.com'" className="btn btn-primary m-1">Orders</button>
                </div>
            </div>
        </>
    );
};

export default NavigateButtons;
